INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(1, 'Web Development', 'This course introduces students to basic web design using HTML (Hypertext Markup Language) and CSS (Cascading Style Sheets). The course does not require any prior knowledge of HTML or web design. Throughout the course students are introduced to planning and designing effective web pages; implementing web pages by writing HTML and CSS code; enhancing web pages with the use of page layout techniques, text formatting, graphics, images, and multimedia; and producing a functional, multi-page website.', , 'image/jpeg', 21000, '2018-08-11 04:00:49', '2018-08-15 01:23:50', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(2, 'Graphics Design with Adobe Photoshop', 'This course introduces basic Photoshop design techniques. You\'ll learn how to work with layers, combine images, use layer masks, and add creative graphics, text, and effects. You\'ll use these skills to combine design assets into a simple, unique composite for print or online use. Have fun following along with your own images or the sample files provided in class.', , 'image/jpeg', 1000, '2018-08-11 04:03:31', '2018-08-15 01:22:18', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(3, 'English as a Foreign Language', 'This course will provide instruction in academic and professional language skills for non-native speakers of English. Emphasis is placed on the development of integrated language skills for use in studying a particular content area. Upon completion, students should be able to demonstrate improved language skills for participation and success within the particular topic area.', , 'image/jpeg', 1500, '2018-08-11 04:03:56', '2018-08-15 19:56:54', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(4, 'LAMP Stack Deployment', 'LAMP is an acronym for Linux-the Operating system, Apache HTTP server, MySQL-an RDBMS (Relational Database Management System), and PHP programming language to develop web applications. The LAMP training masters program is designed to impart a thorough knowledge of LAMP stack technologies like Linux, MySQL, and PHP. The learning path ensures that you gain expertise in the various components of LAMP stack such as writing codes in Linux, designing a database using MySQL, and creating powerful applications using PHP. As electives, the learning path comprises Perl and Python which are additional skill sets to ensure you become a LAMP stack genius.', , 'image/jpeg', 250, '2018-08-11 04:04:26', '2018-08-15 01:22:53', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(5, 'Human Resources Management', 'This course examines the role of the human resource professional as a strategic partner in managing today\'s organizations. Key functions such as recruitment, selection, development, appraisal, retention, compensation, and labour relations are examined. Implications of legal and global environments are appraised and current issues such as diversity training, sexual harassment policies, and rising benefit costs are analyzed. Best practices of employers of choice are considered.', , 'image/jpeg', 15750, '2018-08-11 04:04:53', '2018-08-15 01:22:33', 1);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(6, 'Project Management Fundamentals', 'Project Management Fundamentals is a two-day action-learning course of instruction led by a certified facilitator in a formal classroom environment. It is designed to provide participants with a broad understanding of project management principles, concepts, tools, and techniques along with the global standards from which they are derived. The primary objectives of Project Management Fundamentals are to (1) empower participants with the vocabulary, knowledge competencies, and basic performance competencies necessary to intuitively understand and function at a high level in their project supporting roles and (2) to organize and execute their own day-to-day work in a more efficient manner using modern project management concepts and methods.', , 'image/jpeg', 17500, '2018-08-11 04:05:14', '2018-08-15 01:23:14', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(7, 'Information Security', 'This course emphasizes the development and promotion of an information security mission for an organization in accordance with its overall goals and objectives. Students will learn how to identify the roles and responsibilities of each member of an organization in order to develop controls that provide security while maintaining adequate access. Issues such as employment practices, procedures and agreements will be discussed along with policy formation, security awareness training and data classification.', , 'image/jpeg', 19750, '2018-08-11 04:05:51', '2018-08-15 01:22:43', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(8, 'Quality Management Standards', 'The course applies knowledge of Statistic, Basic management, Organization behaviour, Organizational design, Marketing for practical purposes. The purpose of this course is using the knowledge as managerial practice, development of managerial skills. In the frame of the course, students must improve skills of analysis and assessment of quality management systems. Moreover, students must understand and use terminology, can develop managerial decision and to plan, and control of quality. The course\'s aim is to learn theoretical base, modern experience and actual worldwide trends of management in the field of quality. The results of the course for the students must be the understanding of quality essence, its management and roles of the wide range of actors; knowledge of the main methods and modern approaches of quality management; ISO 9000 standards.', , 'image/jpeg', 12000, '2018-08-11 04:07:51', '2018-08-16 15:34:27', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
(9, 'Public Relations', 'This course provides you with an overview of public relations. It covers the roles and responsibilities of public relations professionals and introduces you to the tools and tasks of practitioners. Finally, it provides you with insight into industry challenges and trends.', , 'image/jpeg', 9900, '2018-08-11 04:09:05', '2018-08-15 01:23:28', 0);
INSERT INTO `course` (`id`, `name`, `description`, `image`, `image_mime`, `price`, `created`, `modified`, `deleted`) VALUES
